function process_time(){var e=parseInt(document.getElementById("time").innerHTML);document.getElementById("time").innerHTML=e+1,document.getElementById("h").innerHTML=("0"+parseInt(e/3600)).slice(-2),document.getElementById("m").innerHTML=("0"+parseInt(e%3600/60)).slice(-2),document.getElementById("s").innerHTML=("0"+parseInt(e%3600%60)).slice(-2)}function load_temp(){document.getElementById("temp").innerHTML="Loading...";var e=createXmlHttpRequestObject();e.addEventListener("load",fill_temp),e.open("GET","http://192.168.4.1/get_temp",!0),e.send()}function load_table(){var e=createXmlHttpRequestObject();e.addEventListener("load",fill_table),e.open("GET","http://192.168.4.1/data",!0),e.send()}function load_time(){var e=createXmlHttpRequestObject();e.addEventListener("load",function(){document.getElementById("time").innerHTML=this.responseText}),e.open("GET","http://192.168.4.1/get_uptime",!0),e.send()}function fill_table(){var e=this.responseText.split(";").slice(0,-1),t="",n=0;for(i in e)i<10&&(n+=parseFloat(e[i])),t+='<tr class="'+(i%2?"a":"b")+'"><td>'+i+"</td><td>"+e[i]+"</td></tr>";document.getElementById("avg").innerHTML=parseFloat(n/10).toFixed(2),document.getElementById("table-body").innerHTML=t}function fill_temp(){document.getElementById("sun").className="hidden",document.getElementById("ice").className="hidden",document.getElementById("cloud").className="hidden",document.getElementById("temp").innerHTML=this.responseText,parseFloat(document.getElementById("temp").innerHTML<0)?document.getElementById("ice").className="":parseFloat(document.getElementById("temp").innerHTML<20)?document.getElementById("cloud").className="":document.getElementById("sun").className=""}function createXmlHttpRequestObject(){try{xmlHttp=new XMLHttpRequest}catch(e){try{xmlHttp=new ActiveXObject("Microsoft.XMLHttp")}catch(e){}}if(xmlHttp)return xmlHttp;alert("Error creating the XMLHttpRequest object.")}